// src/App.js
import React from 'react';
import PuzzleGame from './components/PuzzleGame';

function App() {
  const handleComplete = () => {
    console.log('Puzzle completed!');
  };

  return (
    <div>
      <PuzzleGame onComplete={handleComplete} />
    </div>
  );
}

export default App;
